import React from 'react';
import Input from "./components/input";
import './App.css';
import List from "./components/list";
import background from "./background1.png";


function App() {
  return (
    <>
      <div style={{backgroundImage: `url(${background})`, 
      background}}>
      <div className='container'>
      <Input />
      <List />
      </div>
    </div>
    </>
  );
}

export default App;
